package com.EsportLeagueStats.ESLS.web.requests;public class AddTimRequest {    private String ime;    private String logo;    private int ligaId;    public AddTimRequest(){}    public AddTimRequest(String ime, String logo, int ligaId) {        this.ime = ime;        this.logo = logo;        this.ligaId = ligaId;    }    public String getIme() {        return ime;    }    public String getLogo() {        return logo;    }    public int getLigaId() {        return ligaId;    }}